import React from "react";
// Using a static import for images (requires proper module declarations)
// If this doesn't work, you can also use:
const logo = "/logo.svg"; // Assuming the logo is in the public folder
// import logo from '../../../assets/images/logo.svg';
interface HeaderProps {
  logo?: string;
}

const Header: React.FC<HeaderProps> = ({ logo }) => {
  return (
    <header className="p-4">
      {logo && <img src={logo} alt="Logo" className="h-8" />}
    </header>
  );
};

export default Header;
